import React from "react";
import "./Companyvision.css";
import images from "../../constant/images";
const Companyvision = () => {
  return (
    <main>
      <div className="cVision_sec">
        <div className="cVision_inner">
          <div className="cVision_us">
            <h1>About us</h1>
            <p style={{ width: "500px" }}>
              Welcome to Plastaps, the leading middleware platform for plastic
              virgin resins, recycle resins, and regrinded resins. We are a
              vibrant community of buyers and sellers dedicated to creating a
              sustainable and efficient marketplace for the plastic industry.
              With a comprehensive selection of PP, PE, PS, PVC, and PET resins,
              we connect businesses from various sectors, empowering them to
              make responsible and informed decisions.
            </p>
          </div>
          <div className="cVision_img">
            <img src={images.aboutus} className="cVision_image_size" />
          </div>
        </div>
      </div>
    </main>
  );
};

export default Companyvision;
